const getCars = async () => {
    const res = fetch("/api/cars");
    if (!res.ok) {
        throw {
            message: "Something went wrong",
            statusCode: res.statusCode,
            statusText: (await res).statusText
        }
    }
    const data = await res.json()
    return data.cars;
}

export default getCars;
